import {Link} from "react-router-dom";


function ShopperInvalidUserComponent() {


    return (
        <div className="container-fluid text-danger">
            <h2>Invalid User Or Password</h2>
            <div>
                <Link to="/login">Try again</Link>
            </div>
        </div>
    )
}
export default ShopperInvalidUserComponent;
